import React from 'react';
import { BrowserRouter as Router, Route, Switch, useHistory, Routes } from 'react-router-dom';
import ThankYou from './ThankYou';

function App() {
  const history = useHistory();

  const submission = () => {
    // ... handle your submission logic here ...

    // Navigate to the Thank You page after submission
    history.push("/thankyou");
  };

  return (
    <Router>
      <div>
        <Routes>
          <Route exact path="/">
            <div>
              {/* ... rest of your form/input components ... */}
              <button onClick={submission}>Submit</button>
            </div>
          </Route>

          <Route path="/thankyou" component={ThankYou} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
